import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import PaginaPrincipal from './PaginaPrincipal';
import Chatbot from './Chatbot';
import Donaciones from './Donaciones.jsx';
import IniciarSecion from './IniciarSesion';
import RegistroCoder from './RegistroCoder';
import RegistroCrafter from './RegistroCrafter';
import SubirReto from './SubirReto';
import inicio from './logofoto.png'; // Asegúrate de tener la imagen en la ruta correcta
import './App.css'; // Asegúrate de definir el CSS correctamente

function App() {
  return (
    <Router>
      <div className="app">
        <header className="app-header">
          <nav className="navbar">
            <ul className="nav-links">
              <li className="nav-item">
                <Link to="/">
                  <img src={inicio} alt="Inicio" className="logo" />
                </Link>
              </li>
              <li className="nav-item"><Link to="/donaciones">Donaciones</Link></li>
              <li className="nav-item2"><Link to="/sobre-nosotros">Sobre nosotros</Link></li>
              <li className="nav-item3"><Link to="/comentarios">Comentarios</Link></li>
              <li className="nav-item4"><Link to="/chatbot">Chat bot</Link></li>
              <li className="nav-item4"><Link to="/subirreto">Subir reto</Link></li>
              <li className="nav-item5"><Link to="/iniciarsecion">Iniciar sesión</Link></li>
              <li className="nav-item6"><Link to="/registrocoder">Registro coder</Link></li>
            </ul>
            <button className="create-challenge-btn">+ Crear reto</button>
          </nav>
        </header>

        <main className="main-content">
          {/* Aquí usas Routes y Route para definir las rutas */}
          <Routes>
            <Route path="/" element={<PaginaPrincipal />} />
            <Route path="/donaciones" element={<Donaciones />} />
            <Route path="/sobre-nosotros" element={<PaginaPrincipal />} /> {/* Cambia este componente si tienes uno para "Sobre nosotros" */}
            <Route path="/comentarios" element={<PaginaPrincipal />} /> {/* Cambia este componente si tienes uno para "Comentarios" */}
            <Route path="/chatbot" element={<Chatbot />} />
            <Route path="/subirreto" element={<SubirReto />} />
            <Route path="/iniciarsecion" element={<IniciarSecion />} />
            <Route path="/registrocoder" element={<RegistroCoder />} />
          </Routes>
        </main>

        <footer className="app-footer">
          <p>© TimeData2024</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
